define({"topics" : [{"title":"System General Settings","shortdesc":"\n               <p class=\"shortdesc\">The system general settings can be applied globally to  <span class=\"ph\">Yeastar Cloud PBX</span></p>\n            ","id":"concept_htb_p4w_d2b","href":"topic\/system_general_settings.html","menu": {"hasChildren":false,},"tocID":"concept_htb_p4w_d2b-d46e15983","next":"concept_htb_p4w_d2b-d46e15983",},{"title":"Security","id":"topic_u21_hyh_ffb","href":"topic\/secuirty.html","menu": {"hasChildren":false,},"tocID":"topic_u21_hyh_ffb-d46e16280","next":"topic_u21_hyh_ffb-d46e16280",},{"title":"User Permission","shortdesc":"\n               <p class=\"shortdesc\">By default, the extension users can log in the system and check their own settings         and CDR. You can set different\n                  permission to the users according to their roles and         duty.\n               </p>\n            ","id":"concept_ojf_43k_xdb","href":"topic\/user_permission.html","menu": {"hasChildren":false,},"tocID":"concept_ojf_43k_xdb-d46e16496","next":"concept_ojf_43k_xdb-d46e16496",},{"title":"Date and Time","shortdesc":"\n               <p class=\"shortdesc\">To ensure that the time of logs and CDR is consistent with your local time , you need         to adjust the date and time\n                  of the PBX.\n               </p>\n            ","id":"concept_a4v_p3k_xdb","href":"topic\/date_and_time.html","menu": {"hasChildren":false,},"tocID":"concept_a4v_p3k_xdb-d46e16642","next":"concept_a4v_p3k_xdb-d46e16642",},{"title":"Email","shortdesc":"\n               <p class=\"shortdesc\">The system email can be used to reset password, send voicemail to email, send alert         event emails, and send fax   \n                  to email. To make these features work, you need to set up the PBX system email.\n               </p>\n            ","id":"concept_ls5_r3k_xdb","href":"topic\/email.html","menu": {"hasChildren":false,},"tocID":"concept_ls5_r3k_xdb-d46e16785","topics":[]},{"title":"Auto Cleanup","shortdesc":"\n               <p class=\"shortdesc\">Auto Cleanup is a feature that can auto clean your CDR, logs, voicemails, one-touch             recordings periodically.</p>\n            ","id":"concept_fy5_hrr_xdb","href":"topic\/auto_cleanup.html","menu": {"hasChildren":false,},"tocID":"concept_fy5_hrr_xdb-d46e16858","topics":[]},{"title":"Event Center","shortdesc":"\n               <p class=\"shortdesc\">You can set the PBX to send notifications when specific events or errors occur,         notifying you via email.</p>\n            ","id":"concept_jjr_xwr_xdb","href":"topic\/event_center.html","menu": {"hasChildren":false,},"tocID":"concept_jjr_xwr_xdb-d46e16931","next":"concept_jjr_xwr_xdb-d46e16931",}]});